import React, { Component } from "react";

export default class NavigationComponent extends Component {
  render() {
    const boxStyle = {
      padding: "10px",
    };

    const linkStyle = {
        color: "white !important",
    }

    const navStyle = {
      fontSize: "18px",
      backgroundColor: "white",
    };

    return (
      <div>
        <nav style={navStyle}>
          <div className="container">
            <ul class="d-flex">
              <li style={boxStyle}>
                <a class = 'text' href="#">Trang Chủ</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Thể Loại</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Xếp Hạng</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Tìm Truyện</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Lịch Sử</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Theo Dõi</a>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    );
  }
}
